script: |
  super -f text -I q3122.spq | sort > q3122.out

inputs:
  - name: q3122.spq
    data: |
      SELECT DISTINCT - + col0 + col0 * ( - col1 ) * - ( - 14 + - cor0.col0 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q3122.out
    data: |
      -1329
      -49984
      -97840
